const Cards = () => {
  const [cards, setCards] = useState ([
    {id: 1, status: '', img: '/dogs/01.jpeg'},
    {id: 1, status: '', img: '/dogs/01.jpeg'},
    {id: 2, status: '', img: '/dogs/02.jpeg'},
    {id: 2, status: '', img: '/dogs/02.jpeg'},
  ]);
  return <div>Cards</div>;
};

export default Cards;
